import './App.css';
import data from './data';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomeScreen from './screens/HomeScreen';

function App() {
  return (
    <BrowserRouter>
    <div>
      <header>
        <a href="/">Qualhygiene</a>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<HomeScreen />} />
        </Routes>

      </main>
    </div>
    </BrowserRouter>
  );

}

export default App;
